import {assets} from "../Assets/assets";
function Header() {
    return (
    <div id = "main-div">
        <div id = "logo-div">
            <img src = {assets.logo} height = {80} width={180} alt = ''/>
            <button>Get Started<img src = {assets.arrow}/></button>
        </div>
            
    </div>
    )
}

export default Header;
